import React, {Component} from 'react';
import { Helmet } from 'react-helmet'

const title = "Projects|Alper Tunca";

class Projects extends Component {
    render() {
        const divStyle = {
            width: "100%",
            background: "#1F1E1A"
        };

        const colorStyle = {
            color: "#34A4EB"
        };

        return (
            <div style={divStyle}>
                <Helmet>
                    <title>{title}</title>
                </Helmet>
                <h1 style={colorStyle}>PROJECTS</h1>
                <p style={colorStyle}>My projects are here, you can open github for more</p>



            </div>
        );
    }
}

export default Projects;
